import React, {Component} from 'react';

class Category extends Component {
    render() {
        return (
            <div>
                <ul>
                    <li className="items2"><a href="" className="links2">Lorem ipsum.</a></li>
                    <li className="items2"><a href="" className="links2">Beatae, voluptatibus!</a></li>
                    <li className="items2"><a href="" className="links2">Dignissimos, quos.</a></li>
                    <li className="items2"><a href="" className="links2">Veniam, voluptates.</a></li>
                    <li className="items2"><a href="" className="links2">Accusantium, harum?</a></li>
                    <li className="items2"><a href="" className="links2">Quidem, repellendus?</a></li>
                    <li className="items2"><a href="" className="links2">Eum, saepe.</a></li>
                    <li className="items2"><a href="" className="links2">Deserunt, voluptatum!</a></li>
                    <li className="items2"><a href="" className="links2">Dolorem, suscipit.</a></li>
                    <li className="items2"><a href="" className="links2">Quos, suscipit?</a></li>
                </ul>
            </div>
        );
    }
}

export default Category;
